import React from 'react';
import { connect } from 'react-redux';
import { findStreams } from '../actions'

class SearchBar extends React.Component {
    formSubmit(e)  {
        e.preventDefault();
        console.log(e);
    }
    render() {
        return (
            <form  onSubmit={this.formSubmit} class="ui fluid search">
                <div class="ui icon input">
                    <input class="prompt" type="text" placeholder="Search streams..."/>
                    <i class="search icon"></i>
                </div>
                <div class="results"></div>
            </form>
        )
    }
}

export default connect(null, { findStreams })(SearchBar);
